column8:
■用途
<BR>
トラックの荷締め、建設現場の芯出し、<BR>

機械等重量物の締め付け・移動、土管・<BR>

ヒューム管埋設、造船・鉱山内等の狭い場所<BR>

での作業、抜根、抜杭などに<BR>

■特徴<BR>

●カラ荷操作は自動空転式です
<BR>
●メンテナンスは簡単です
<BR>
●チェーンは無酸化メッキ仕上げです
<BR>
●くいつき解消機構がついています
<BR>
●フックはコブ付です
<BR><BR>

